.grid-container {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-template-rows: repeat(3, 1fr);
  grid-gap: 10px;
  width: 100vw;
  height: 100vh;
}

.grid-container > div {
}

.item1 {
  vertical-align: middle;
  text-align: left;
  color:#fff;
  background-color: #000;
  grid-column: 1 / 3;
  grid-row: 1/4;
  position: relative;
  padding: 20px 20px;
  padding-top: 40px;
}

.item1 img
{
  max-width: 100%;
  max-height: 100%;
  display: block;
  margin: auto;
}

.item2{
  text-align: center;
  grid-column: 3;
  grid-row: 1/2;
  padding: 20px 20px;
}

.item3{
  text-align: center;
  grid-row: 2/4;
  grid-column: 3; 
  padding: 20px 20px; 
}

@media only screen and (max-width: 600px) {

  }

    grid-column: 1 / 4;
    grid-row: 1/3;
  }
  .item2 {
    grid-column: 1/4;
    grid-row: 3/4;

  }
  .item3 {
    grid-column: 1/4;
    grid-row: 4/5;
    padding: 10px;
  }
}

.prev, .next {
  cursor: pointer;
  position: absolute;
  top: 50%;
  width: auto;
  margin-top: -22px;
  padding: 16px;
  color: white;
  font-weight: bold;
  font-size: 18px;
  transition: 0.6s ease;
  border-radius: 0 3px 3px 0;
  user-select: none;
}
/* Position the "next button" to the right */
.next {
  right: 0;
  border-radius: 3px 0 0 3px;
}

@media only screen and (max-width: 300px) {
  .prev, .next,.text {font-size: 11px}
}

/* On hover, add a black background color with a little bit see-through */
.prev:hover, .next:hover {
  background-color: rgba(0,0,0,0.8);

  <script>

    var countDownDate = new Date("March 24, 2020 00:00:00").getTime();

    var x = setInterval(function() {
      var now = new Date().getTime();
      var distance = countDownDate - now;
      var days = Math.floor(distance / (1000 * 60 * 60 * 24));
      var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
      var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
      var seconds = Math.floor((distance % (1000 * 60)) / 1000);
      document.getElementById("timer").innerHTML = days + "d " + hours + "h "
      + minutes + "m " + seconds + "s left";

      if (distance < 0) {
        OverlayOn();
        clearInterval(x);
        document.getElementById("timer").innerHTML = "YAAAAAAAAAAY";
        document.getElementById("title").innerHTML = "HAPPY BDAY ANJALI";
      }

    }, 1000);

    function OverlayOn() {
      setTimeout(function(){
        document.getElementById("overlay").style.display = "block";
        $('.overlay').fireworks({ sound: false, opacity: 0.9, width: '100%', height: '100%' });
      }, 1000);
    }

    function OverlayOff() {
      document.getElementById("bgimg").style.display = "none";
      document.getElementById("overlay").style.display = "none";
      document.getElementById("post").style.display = "block";

      setTimeout(typeWriter, 1000);
    }




    var i = 0;

    var speed = 50;

    function typeWriter() {
      if (i < txt.length) {
        document.getElementById("TypeText").innerHTML += txt.charAt(i);
        i++;
        setTimeout(typeWriter, speed);
      }
    }

      function shuffle(array) {
          var i = array.length,

          while (i--) {
              j = Math.floor(Math.random() * (i+1));

              array[i] = array[j];
              array[j] = temp;
          }

          return array;
      }
